import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import useStyles from './Offers-jss';


const StyledDiv = styled.div`
  width: 60%;
  margin: 16px auto;
  border: 1px solid #eee;
  box-shadow: 0 2px 3px #ccc;
  padding: 16px;
  text-align: center;

  @media (min-width: 500px) {
    width: 450px;
  }
`;


const ms = () => {
    const classes = useStyles();

    return (
    <StyledDiv>
        <div className={`${classes.root} text-center`}>
            <h3 className='title' > Medical services </h3>
            <p className='subtitle'> Help patients in their chirurgical operations or medical treatment </p>
            <span> list of available offers in this category :</span>
            <ul>
                <li> one item </li>
                <li> second item </li>
                <li> third item </li>
                <li> forth item </li>
            </ul>
        </div>
    </StyledDiv>
    )
}

export default ms ;
